import axios from 'axios';

export default function apiUser(url, method = 'POST', data){

    return axios({
        method: method,
        url: url,
        headers: {
            'Content-Type': 'application/json', 
            'Accept-Charset': 'UTF-8', 
            'Cookie': 'JSESSIONID=751E4FFF1CF8B704C851CC60EA54044C'
        },
        data: data,
    }).catch(err => {
        console.log(err);
    });
};
